import React from 'react';
import './App.css';
import Header from './components/header/header';
import VerticalNav from './components/VerticalNav/VerticalNav';

const App = () => {
  return (
    <div className="App">
        <Header />
      <VerticalNav />
    </div>
  );
};

export default App;
